// src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import DashboardPage from './pages/DashboardPage';
import DeviceControlPage from './pages/DeviceControlPage';
import SettingsPage from './pages/SettingsPage';
import EnterSessionCodePage from './pages/EnterSessionCodePage';
import ControlDevicePage from './pages/ControlDevicePage';

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/enter-session" element={<EnterSessionCodePage />} />
        <Route path="/control-device/:sessionCode" element={<ControlDevicePage />} />
        <Route path="/" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/dashboard" element={<DashboardPage />} />
        <Route path="/device/:id" element={<DeviceControlPage />} />
        <Route path="/settings" element={<SettingsPage />} />
      </Routes>
    </Router>
  );
}

export default App;
